import React, {Component} from 'react';
import { Grid, Cell } from 'react-mdl';

class Landing extends Component {
  render() {
  	return (
  		<div style={{width: '100%', margin: 'auto'}}>
  			<Grid className="landing-grid">
  				<Cell col={12}>
  				
  					<img src="https://www.bing.com/images/search?view=detailV2&ccid=2ciCFJNG&id=C233E0BF0A0C563722DE8476C13D4D204B25B394&thid=OIP.2ciCFJNGQ2ZLFixPAUQQUgHaHa&mediaurl=https%3a%2f%2fwww.shareicon.net%2fdata%2f512x512%2f2015%2f09%2f18%2f103160_man_512x512.png&exph=512&expw=512&q=avatar+male&simid=607991278693387527&selectedIndex=2" alt="avatar" className="avatar-img"/>

  				</Cell>

  			</Grid>

  		</div>
  		
  		)
  }
}
export default Landing;
